import React from 'react';
import './Navbar.css'
const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">Movies</a>
        </li>
        <li>
          <a href="#">TV Series</a>
        </li>
        <li>
          <a href="#">Most Popular</a>
        </li>
        <li>
          <a href="#">Top Airing</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
